import React from "react";

export default function Footer(props) {
    return (
        <div>
            <div className="flex items-center justify-between">
                <p>Home</p>
                <p>About</p>
                <p>Portfolio</p>
                <p>Resume</p>
            </div>
        </div>
    );
}
